import React from "react";
import "./MyOrder.css";
import order_list from './orderList';
import {
  Card,
  CardBody,
  CardTitle,
  CardText,
  ListGroup,
  ListGroupItem
} from "reactstrap";

function MyOrder() {
  let order = order_list;
  let buttonStyle = {
    margin: "5px 5px",
    size: "10px"
  }
  return (
    <section className="col-md-4">
      <Card>
        <CardBody>
          <CardTitle className="font-weight-bold text-center">
            My Order
          </CardTitle>
          <CardText>
            Ordered Items appear below
          </CardText>
          <ListGroup>
            {
              order.map(item => (
                <>
                  <div>
                    <div>{item.name} <span><button className="btn btn-warning" style={buttonStyle}>del</button></span></div>
                  </div>
                </>
              ))
            }
          </ListGroup>
        </CardBody>
      </Card>
    </section>
  );
}

export default MyOrder;
